import React from "react";
import { Avatar, Card, Button } from "antd";

const UserProfile = () => {
  <Card
    action={[
      <div key="twit">
        쨱쨱
        <br />0
      </div>,
      <div key="following">
        팔로잉
        <br />0
      </div>,
      <div key="follower">
        팔로워
        <br />0
      </div>,
    ]}
  >
    <Card.Meta avatar={<Avatar>TAY</Avatar>} title="taylor" />
    <Button>로그아웃</Button>
  </Card>;
};

export default UserProfile;
